tables.table_schema:
CREATE TABLE AlgorithmPerformanceTrack (
  algorithm_id INT PRIMARY KEY,
  algorithm_name TEXT NOT NULL,
  execution_time FLOAT NOT NULL
);

CREATE TABLE IndexOptimization (
  index_id INT PRIMARY KEY,
  algorithm_id INT REFERENCES AlgorithmPerformanceTrack(algorithm_id),
  optimizer_name TEXT NOT NULL,
  optimization_metric FLOAT NOT NULL
);

CREATE TABLE Algorithm_Performance (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time FLOAT,
    index_used VARCHAR(50)
);

CREATE TABLE algorithm_performance (
    id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time FLOAT,
    performance_score INT
);

CREATE TABLE algorithm_metrics (
    id INT PRIMARY KEY,
    algorithm_id INT,
    metric_name VARCHAR(255),
    metric_value FLOAT
);

CREATE TABLE optimization_logs (
    id INT PRIMARY KEY,
    algorithm_id INT,
    execution_timestamp TIMESTAMP,
    optimization_steps TEXT
);
